                <div style={{marginRight:"50px"}}>
                    <img style={{width:"150px",height:"140px",borderRadius:"100%"}} src="https://pbs.twimg.com/media/Ez5yIwsVUAcW-U0.jpg:large" />
                </div>
                <div>
                    <h4>Pawan Kalyan</h4>
                    <div style={{display: "flex",justifyContent: "space-around",margin: "20px 0px"}}>
                        <div>80 posts</div>
                        <div>' 200 followers</div>
                        <div>' 100 following</div>
                    </div>
                </div>
            </div>
        </div>       
    );
}

